import React from "react";

import Header from "./Header";
import Footer from "./Footer";

import "../styles/layout.css"

const MobileLayout = (props: any) => {
    return (
        <>
            <Header />
            <div className="wrap">
                <div className="content">props.children</div>
            </div>
            <Footer />
        </>
    )
}

export default MobileLayout
